ities is part of a new flagship documentary strand from WIRED Video that explores the technologies, trends and ideas that are changing our world. Subscribe to the WIRED YouTube channel to ensure you never miss an episode.\\n\\nHOLY LAND: STARTUP NATIONS (SERIES 2)\\nPremiering in February, the second season of WIRED’s Future Cities series takes us inside one of the world’s biggest startup nations. With the most tech startups and venture capital per capita in the world, Israel has long been hailed as The Startup Nation. WIRED’s four-part series will look beyond Tel Aviv’s vibrant, liberal tech epicentre to the wider Holy Land region – the Palestinian territories, where a parallel Startup Nation story is emerging in East Jerusalem, Ramallah and the West Bank, as well as in the Israeli cybersecurity hub of Beersheba. And we will learn how the fertile innovation ecosystem of Silicon Wadi has evolved as a result of its unique political, geographical and cultural situation and explore the future challenges – and solutions – these nations are facing.\\n\\nCONNECT WITH WIRED\\nWeb: http:\/\/po.st\/WiredVideo\\nTwitter: http:\/\/po.st\/TwitterWired\\nFacebook: http:\/\/po.st\/FacebookWired\\nGoogle+: http:\/\/po.st\/GoogleWired\\nInstagram: http:\/\/po.st\/InstagramWired\\nMagazine: http:\/\/po.st\/MagazineWired\\nNewsletter: http:\/\/po.st\/NewslettersWired\\n\\nABOUT WIRED\\nWIRED brings you the future as it happens - the people, the trends, the big ideas that will change our lives. An award-winning printed monthly and online publication. WIRED is an agenda-setting magazine offering brain food on a wide range of topics, from science, technology and business to pop-culture and politics.\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/SGJ5cZnoodY\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLAcY3OGtIzlWNdvdIvzopicCbsU9w\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\ ure Cities, a full-length documentary strand from WIRED Video, takes us inside the bustling Chinese city of Shenzhen. \\nSubscribe to WIRED►► http:\/\/po.st\/SubscribeWired\\n\\nWe examine the unique manufacturing ecosystem that has emerged, gaining access to the world’s leading hardware-prototyping culture whilst challenging misconceptions from the west. The film looks at how the evolution of “Shanzhai” – or copycat manufacturing – has transformed traditional models of business, distribution and innovation, and asks what the rest of the world can learn from this so-called “Silicon Valley of hardware\\\".\\n\\nABOUT FUTURE CITIES\\nFuture Cities is part of a new flagship documentary strand from WIRED Video that explores the technologies, trends and ideas that are changing our world. Subscribe to the WIRED YouTube channel to ensure you never miss an episode.\\n\\nHOLY LAND: STARTUP NATIONS (SERIES 2)\\nPremiering in February, the second season of WIRED’s Future Cities series takes us inside one of the world’s biggest startup nations. With the most tech startups and venture capital per capita in the world, Israel has long been hailed as The Startup Nation. WIRED’s four-part series will look beyond Tel Aviv’s vibrant, liberal tech epicentre to the wider Holy Land region – the Palestinian territories, where a parallel Startup Nation story is emerging in East Jerusalem, Ramallah and the West Bank, as well as in the Israeli cybersecurity hub of Beersheba. And we will learn how the fertile innovation ecosystem of Silicon Wadi has evolved as a result of its unique political, geographical and cultural situation and explore the future challenges – and solutions – these nations are facing.\\n\\nCONNECT WITH WIRED\\nWeb: http:\/\/po.st\/WiredVideo\\nTwitter: http:\/\/po.st\/TwitterWired\\nFacebook: http:\/\/po.st\/FacebookWired\\nGoogle+: http:\/\/po.st\/GoogleWired\\nInstagram: http:\/\/po.st\/InstagramWired\\nMagazine: http:\/\/po.st\/MagazineWired\\nNewsletter: http:\/\/po.st\/NewslettersWired\\n\\nABOUT WIRED\\nWIRED brings you the future as it happens - the people, the trends, the big ideas that will change our lives. An award-winning printed monthly and online publication. WIRED is an agenda-setting magazine offering brain food on a wide range of topics, from science, technology and business to pop-culture and politics.\"},\"lengthSeconds\":\"4071\",\"ownerProfileUrl\":\"http:\/\/www.youtube.com\/user\/WiredVideoUK\",\"externalChannelId\":\"UCWrXlzhIENTJrAuKVuPgdEA\",\"isFamilySafe\":true,\"availableCountries\":[\"AD\",\"AE\",\"AF\",\"AG\",\"AI\",\"AL\",\"AM\",\"AO\",\"AQ\",\"AR\",\"AS\",\"AT\",\"AU\",\"AW\",\"AX\",\"AZ\",\"BA\",\"BB\",\"BD\",\"BE\",\"BF\",\"BG\",\"BH\",\"BI\",\"BJ\",\"BL\",\"BM\",\"BN\",\"BO\",\"BQ\",\"BR\",\"BS\",\"BT\",\"BV\",\"BW\",\"BY\",\"BZ\",\"CA\",\"CC\",\"CD\",\"CF\",\"CG\",\"CH\",\"CI\",\"CK\",\"CL\",\"CM\",\"CN\",\"CO\",\"CR\",\"CU\",\"CV\",\"CW\",\"CX\",\"CY\",\"CZ\",\"DE\",\"DJ\",\"DK\",\"DM\",\"DO\",\"DZ\",\"EC\",\"EE\",\"EG\",\"EH\",\"ER\",\"ES\",\"ET\",\"FI\",\"FJ\",\"FK\",\"FM\",\"FO\",\"FR\",\"GA\",\"GB\",\"GD\",\"GE\",\"GF\",\"GG\",\"GH\",\"GI\",\"GL\",\"GM\",\"GN\",\"GP\",\"GQ\",\"GR\",\"GS\",\"GT\",\"GU\",\"GW\",\"GY\",\"HK\",\"HM\",\"HN\",\"HR\",\"HT\",\"HU\",\"ID\",\"IE\",\"IL\",\"IM\",\"IN\",\"IO\",\"IQ\",\"IR\",\"IS\",\"IT\",\"JE\",\"JM\",\"JO\",\"JP\",\"KE\",\"KG\",\"KH\",\"KI\",\"KM\",\"KN\",\"KP\",\"KR\",\"KW\",\"KY\",\"KZ\",\"LA\",\"LB\",\"LC\",\"LI\",\"LK\",\"LR\",\"LS\",\"LT\",\"LU\",\"LV\",\"LY\",\"MA\",\"MC\",\"MD\",\"ME\",\"MF\",\"MG\",\"MH\",\"MK\",\"ML\",\"MM\",\"MN\",\"MO\",\"MP\",\"MQ\",\"MR\",\"MS\",\"MT\",\"MU\",\"MV\",\"MW\",\"MX\",\"MY\",\"MZ\",\"NA\",\"NC\",\"NE\",\"NF\",\"NG\",\"NI\",\"NL\",\"NO\",\"NP\",\"NR\",\"NU\",\"NZ\",\"OM\",\"PA\",\"PE\",\"PF\",\"PG\",\"PH\",\"PK\",\"PL\",\"PM\",\"PN\",\"PR\",\"PS\",\"PT\",\"PW\",\"PY\",\"QA\",\"RE\",\"RO\",\"RS\",\"RU\",\"RW\",\"SA\",\"SB\",\"SC\",\"SD\",\"SE\",\"SG\",\"SH\",\"SI\",\"SJ\",\"SK\",\"SL\",\"SM\",\"SN\",\"SO\",\"SR\" MkAxNTkzMDg0MzQy","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\n\nWe examine the unique manufacturing ecosystem that has emerged, gaining access to the world’s leading hardware-prototyping culture whilst challenging misconceptions from the west. The film looks at how the evolution of “Shanzhai” – or copycat manufacturing – has transformed traditional models of business, distribution and innovation, and asks what the rest of the world can learn from this so-called “Silicon Valley of hardware\".\n\nABOUT FUTURE CITIES\nFuture Cities is part of a new flagship documentary strand from WIRED Video that explores the technologies, trends and ideas that are changing our world. Subscribe to the WIRED YouTube channel to ensure you never miss an episode.\n\nHOLY LAND: STARTUP NATIONS (SERIES 2)\nPremiering in February, the second season of WIRED’s Future Cities series takes us inside one of the world’s biggest startup nations. With the most tech startups and venture capital per capita in the world, Israel has long been hailed as The Startup Nation. WIRED’s four-part series will look beyond Tel Aviv’s vibrant, liberal tech epicentre to the wider Holy Land region – the Palestinian territories, where a parallel Startup Nation story is emerging in East Jerusalem, Ramallah and the West Bank, as well as in the Israeli cybersecurity hub of Beersheba. And we will learn how the fertile innovation ecosystem of Silicon Wadi has evolved as a result of its unique political, geographical and cultural situation and explore the future challenges – and solutions – these nations are facing.\n\nCONNECT WITH WIRED\nWeb: "},{"text":"http://po.st/WiredVideo","navigationEndpoint":{"clickTrackingParams":"CJABEM2rARgBIhMI94_c0u2c6gIV9grxBR0vJARPSNbDos-Zrp6xSA==","commandMetadata":{"webCommandMetadata":{"url":"/redirect?v=SGJ5cZnoodY\u0026event=video_description\u0026q=http%3A%2F%2Fpo.st%2FWiredVideo\u0026redir_token=H7xLYu_bNNrC_P4AAefBA2lI5zJ8MTU5MzE3MDc0MkAxNTkzMDg0MzQy","rootVe":83769}}           };
        };

        if (window.loadDataHook) {
          var pageData = window.getPageData();
          window.loadDataHook(pageData.endpoint, pageData.data);
          window.loadDataHook = null;
        }
        setFiller();

    })();
  </script>
